/**
            * All input variables needs to be passed as function param;
            * Objects received as param needs to be parsed. Ex.: JSON.parse(inputVariable1);
            * Objects returned needs to be stringfied. Ex.: JSON.stringify(inputVariable1);
            **/
            function run(inputVariable1, inputVariable2) {
                var array = {};
                var json = JSON.parse(inputVariable1);

                for (var i = 0; i < json.length; i++) {
                    array[i] = {
                        "name": json[i].full_name,
                        "avatar_url": json[i].owner.avatar_url,
                        "description": json[i].description
                    } 
                }

                return array; //Return value will be saved as "Return value variable" field name
            }
